function App() {
  return (
    <>
   <div class="container">
  <div class="navbar"><Navbar/></div>
  <div class="sidebar"></div>
  <div class="side-navbar" style={{backgroundColor:'black'}}><img  style={{width:"100px",alignItems:'center'}} src='/icons/TaxAdda-img.png'></img></div>
